const prepareImages = imageData => {
  const { id, title, images } = imageData;
  return {
    id,
    title,
    webp: images.fixed_width.webp ? images.fixed_width.webp : images.fixed_width.url,
    gif: images.fixed_width.url,
    still: images.fixed_width_still.url
  };
};

export default prepareImages;
